import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Form from 'react-bootstrap/Form';

function FormTextExample() {
  return (
    <>
      <Form.Label htmlFor="inputPassword5">Search for names</Form.Label>
      <Form.Control
        id="inputPassword5"
      />
    </>
  );
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <h3>Learn how to pronounce people's names correctly</h3>
      </header>
      <body>
        <FormTextExample/>
      </body>
    </div>
  );
}

export default App;
